    this.state = {
      isLoggedIn: false,
    };
  }
  // Method to handle button sign in
  handleSignIn = () => {
    this.setState({ isLoggedIn: true });
    console.log(this);
  };

  // Method to handle button sign out
  handleSignIn = () => {
    this.setState({ isLoggedIn: true });
    console.log(this);
  };

  render() {
    return (
      <div>
        <MethodsAsPropsChild
          isLoggedIn={this.state.isLoggedIn}
          handleSignIn={this.handleSignIn}
        />
      </div>
    );
  }
}

export default MethodsAsPropsParent;
